import React ,{ Component } from 'react'
import { Select } from 'semantic-ui-react'

const types = []

class FilterSelect extends Component{

    collectTargetTypes = () => {
        if(this.props.data){
            this.props.data.map((post)=> {
                if(!types.includes(post.targeting)){
                    types.push(post.targeting)
                }             
                    })
        }
        console.log(types)
    }

    render(){
        console.log('rendin', this.props.data)
        this.collectTargetTypes()
        return(
            <Select compact options={''} defaultValue='articles' />
        )
    }
}

export default FilterSelect
